import React from "react";
import Search from "../../components/Search";
import { Link } from "react-router-dom";
import Header from "../../components/Header";
import Logo from "../../components/TMDB-Image";
import "../../components/Search/Search.css";

const Home = () => {
  return (
    /*
        <div>
            <div style={{display:'flex', flexDirection:'row'}} >
                <Header />
            </div>


            <div style={{ display:'flex', flexDirection:'row', alignItems:'center', justifyContent:'center', width:'100%'}}>   
                    <h1>The Movie Hub</h1>
                    <i className="fas fa-film fa-4x" style={{width:'70px', marginLeft: '10px'}}></i>

            </div>



                <div /lassName="filter-button">
                     <Link to={'/filter'}>
                        <button style={{cursor: 'pointer',
                            backgroundColor: 'gray',
                            width:'120px',
                            height:'50px',
                            color: 'white'}}>Discover One!</button>
                     </Link>
                </div>


            <Logo/>
            */

    <div>
      <div>
        <Header />
      </div>

      <span
        style={{
          justifyContent: "center",
          display: "flex",
          flexDirection: "row",
        }}
      >
        <h1>The Movie Hub</h1>
        <i
          style={{ marginLeft: "10px", marginTop: "15px" }}
          className="fas fa-film fa-3x"
        ></i>
      </span>

      <Search />
      <div className="filter">
        <Link to={"/filter"}>
          <button className="filter-button">Discover One!</button>
        </Link>
      </div>

      <Logo />
    </div>
  );
};

export default Home;
